import React from 'react';
import JobList from '../components/User/JobList';
import ApplicationStatus from '../components/User/ApplicationStatus';

const UserDashboard = () => {
    return (
        <div>
            <h1>User Dashboard</h1>
            <JobList />
            <ApplicationStatus />
        </div>
    );
};

export default UserDashboard;
